Print '
****************************************************************
	Prepare the data in the tables for the tests.
	
	This script will be run every time the system tests
	needs to reset the data.
****************************************************************
';


use [$TARGET_DB_NAME]
PRINT '
*****************************************
    Delete all records in database
*****************************************'
Truncate table BuildVersion;
Truncate Table ErrorLog;

-- Disable all the constraint in database

DECLARE @sql nvarchar(max) = N'';

;WITH x AS 
(
  SELECT DISTINCT obj = 
      QUOTENAME(OBJECT_SCHEMA_NAME(parent_object_id)) + '.' 
    + QUOTENAME(OBJECT_NAME(parent_object_id)) 
  FROM sys.foreign_keys
)
SELECT @sql += N'ALTER TABLE ' + obj + N' NOCHECK CONSTRAINT ALL;
' FROM x;

EXEC sys.sp_executesql @sql;
GO
-- -----

Declare @TableName nvarchar(256) ;
SET @TableName = '';

WHILE @TableName IS NOT NULL
BEGIN
    SET @TableName = 
    (
        SELECT MIN(QUOTENAME(TABLE_SCHEMA) + '.' + QUOTENAME(TABLE_NAME))
        FROM    INFORMATION_SCHEMA.TABLES
        WHERE       TABLE_TYPE = 'BASE TABLE'
            AND QUOTENAME(TABLE_SCHEMA) + '.' + QUOTENAME(TABLE_NAME) > @TableName
    )
print 'Deleting from table '+@TableName ;

DECLARE @sql nvarchar(max) = N'Delete from ' + @tablename;
EXEC sys.sp_executesql @sql;
ENd
GO

-------

DECLARE @sql nvarchar(max) = N'';

;WITH x AS 
(
  SELECT DISTINCT obj = 
      QUOTENAME(OBJECT_SCHEMA_NAME(parent_object_id)) + '.' 
    + QUOTENAME(OBJECT_NAME(parent_object_id)) 
  FROM sys.foreign_keys
)
SELECT @sql += N'ALTER TABLE ' + obj + N' WITH CHECK CHECK CONSTRAINT ALL;
' FROM x;

EXEC sys.sp_executesql @sql;
GO

