INSERT [SalesLT].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) 
																			   VALUES (8, N'Suitable for any type of riding, on or off-road. Fits any budget. Smooth-shifting with a comfortable ride.', N'8e6746e5-ad97-46e2-bd24-fcea075c3b52', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (64, N'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to go off-road.', N'7b1c4e90-85e2-4792-b47b-e0c424e2ec94', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (128, N'Serious back-country riding. Perfect for all levels of competition. Uses the same HL Frame as the Mountain-100.', N'130709e6-8512-49b9-9f62-1f5c99152056', CAST(N'2008-03-11T10:32:17.973' AS DateTime))
                                                                                    , (209, N'Entry level adult bike; offers a comfortable ride cross-country or down the block. Quick-release hubs and rims.', N'f5ff5ffd-cb7c-4ad6-bbc9-4d250bb6e98d', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (513, N'All-occasion value bike with our basic comfort and safety features. Offers wider, more stable tires for a ride around town or weekend trip.', N'741eae59-5e59-4dbc-9086-2633392c2582', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (554, N'The plush custom saddle keeps you riding all day,  and there''s plenty of space to add panniers and bike bags to the newly-redesigned carrier.  This bike has stability when fully-loaded.', N'ddc955b2-843e-49ce-8f7b-54870f6135eb', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (594, N'Travel in style and comfort. Designed for maximum comfort and safety. Wide gear range takes on all hills. High-tech aluminum alloy construction provides durability without added weight.', N'32b82c92-e545-4da0-a175-0be710b482fe', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (627, N'All-weather brake pads; provides superior stopping by applying more surface to the rim.', N'ebf2f0a4-89f2-4d31-be48-d8fd278f3024', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (630, N'Wide-link design.', N'28c4682c-38b2-4b61-a2ae-bcac7c7ce29b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (647, N'Each frame is hand-crafted in our Bothell facility to the optimum diameter and wall-thickness required of a premium mountain frame. The heat-treated welded aluminum frame has a larger diameter tube that absorbs the bumps.', N'7ad9e29f-16cf-4db0-b073-cc62d501b61a', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (661, N'Made from the same aluminum alloy as our top-of-the line HL frame, the ML features a lightweight down-tube milled to the perfect diameter for optimal strength. Women''s version.', N'd61c9d54-22c3-4563-a418-0b9dc7e03850', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (848, N'Lightweight, durable, clipless pedal with adjustable tension.', N'03acbb19-749a-48a1-b77e-5d2a48e8dc3a', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1020, N'The LL Frame provides a safe comfortable ride, while offering superior bump absorption in a value-priced aluminum frame.', N'f4c70a6b-bbe8-4774-9d75-393d3f315e9b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1196, N'Heavy duty, abrasion-resistant shorts feature seamless, lycra inner shorts with anti-bacterial chamois for comfort.', N'c65bee64-4dba-47ec-91cd-31356ba379e1', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1205, N'Short sleeve classic breathable jersey with superior moisture control, front zipper, and 3 back pockets.', N'58d86ede-0519-4263-a264-a2b5b01a6c7b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1208, N'Thin, lightweight and durable with cuffs that stay up.', N'9f436663-525d-4cc2-85ba-47d20bcea0ec', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1210, N'Traditional style with a flip-up brim; one-size fits all.', N'66f84b21-1a43-49d3-8883-09cdb77fffef', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1211, N'Unisex long-sleeve AWC logo microfiber cycling jersey', N'12f60253-f8e1-4f76-8142-6232396b8f17', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1487, N'Adapt  tous les usages, sur route ou tout-terrain. Pour toutes les bourses. Changement de braquet en douceur et conduite confortable.', N'5c1dab3a-4b31-4d9d-a14f-3cb61949b79b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1488, N'Ce vlo offre un excellent rapport qualit-prix. Vif et facile  manuvrer, il se conduit en toute tranquillit sur les chemins et les sentiers.', N'79065ec8-2080-4120-a4ea-bfa7ea1f1f9d', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1490, N'Conduite sur terrains trs accidents. Idal pour tous les niveaux de comptition. Utilise le mme cadre HL que le Montain-100.', N'2b6fa2a7-4815-47b6-a6bc-d6aec23b85cc', CAST(N'2008-03-11T10:32:17.973' AS DateTime))
                                                                                    , (1493, N'Vlo d''adulte d''entre de gamme; permet une conduite confortable en ville ou sur les chemins de campagne. Moyeux et rayons  blocage rapide.', N'7943455f-3fbe-44c0-9ac2-7ee642d3944b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1502, N'Vlo de qualit pour tous usages, dot d''un bon niveau de confort et de scurit. Prsente des pneus plus larges et plus stables pour les sorties en ville ou les randonnes du week-end.', N'e5288050-bc5b-45cc-8849-c7d4af2fe2b6', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1503, N'La selle rembourre offre un confort optimal. Le porte-bagages nouvellement remani offre diverses possibilits d''ajout de paniers ou de sacoches. Ce vlo reste parfaitement stable une fois charg.', N'28b132c3-108c-412d-9918-a8c9297dfb73', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1504, N'Voyagez confortablement et avec lgance. Confort et scurit maximum. Large ventail de vitesses pour gravir toutes les ctes. Sa fabrication en alliage d''aluminium haute technologie est synonyme de robustesse, sans ajout de poids.', N'e3bac4a6-220c-4e5e-8261-51e08906c0e8', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1509, N'Patins de freinage pour tous les temps; freinage renforc par l''application d''une plus grande surface sur la jante.', N'5ed8186a-6049-42b1-b1b0-3b1f899c538b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1510, N'Conception liaison large.', N'64723c0c-09d5-497d-83a3-4561818a8f1c', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1517, N'Dot du mme alliage en aluminium que notre cadre HL haut de gamme, le ML possde un tube lger dont le diamtre est prvu pour offrir une rsistance optimale. Version femmes.', N'f3cd990a-b70d-43c8-a075-934a3e98b5aa', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1537, N'Pdales automatiques lgres et robustes avec tension rglable.', N'6a60e7f6-a5cd-4e7b-8612-9340e46bf66d', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1571, N'Le cadre LL en aluminium offre une conduite confortable, une excellente absorption des bosses pour un trs bon rapport qualit-prix.', N'e95e1259-b822-40ee-aa86-7de9f9e0f0ea', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1587, N'Cuissards rsistants  l''usure pour utilisation intensive, doubls  l''intrieur en Spandex, sans couture, peau de chamois anti-bactrie pour un meilleur confort.', N'e11a3c2a-b074-48f9-8226-16d65c2f91c2', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1594, N'Maillot manches courtes classique et anti-transpiration avec contrle de l''humidit, fermeture avant  glissire et 3poches arrire.', N'fb2a5474-9d83-4a9b-bbbd-8ffc9036866e', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1596, N'Fin, lger et rsistant avec des poignets qui restent en place.', N'31d4905c-d37c-4128-bcff-4a35da9c1bb7', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1598, N'Style classique avec une visire relevable; taille unique.', N'fb627d1b-2933-4fbe-a6a4-bf69f2814ec2', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1599, N'Maillot de cycliste en microfibre avec le logo de l''quipe AWV, manches longues, unisexe.', N'4aae6d4f-8320-4f32-99de-bb3b1b13f1ef', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1600, N'Orphan record to deletion test', N'4aae6d4f-1111-4f32-99de-bb3b1b13f1ef', CAST(N'2020-06-01T00:00:00.000' AS DateTime))
                                                                                    , (1605, N'Chaque cadre est fabriqu artisanalement dans notre atelier de Bordeaux afin d''obtenir le diamtre et l''paisseur adapts  un vlo tout-terrain de premier choix. Le cadre en aluminium soud  chaud prsente un tube d''un plus grand diamtre, afin d''absorber les bosses.', N'9cfed570-180a-44ea-8233-55116a0ddcb9', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
